import React from 'react';
import Button from '@material-ui/core/Button';
import Dialog from '@material-ui/core/Dialog';
import DialogActions from '@material-ui/core/DialogActions';
import DialogContent from '@material-ui/core/DialogContent';
import DialogContentText from '@material-ui/core/DialogContentText';
import DialogTitle from '@material-ui/core/DialogTitle';

export default function AlertDialog(props) {
  const [open, setOpen] = React.useState(false);
  const[ans_alert,setAns_alert]=React.useState(false)

  const handleClickOpen = () => {

    console.log("submitting");
    setOpen(true);

  };

  const handleClose = () => {
    setOpen(false);
  };

  return (
    <div>
        <Button className="btnSubmit" variant="contained" color="primary"  disableElevation onClick={props.submit}>
      SubmitSubmit

    </Button>

    <Button className="btnSubmit" variant="contained" color="primary"  disableElevation onClick={handleClickOpen}>
      Are you sure ?
    </Button>

      <Dialog
        open={open}
        onClose={handleClose}
        aria-labelledby="alert-dialog-title"
        aria-describedby="alert-dialog-description"
      >
        <DialogTitle id="alert-dialog-title">{"Use Google's location service?"}</DialogTitle>
        <DialogContent>
          <DialogContentText id="alert-dialog-description">
            {props.correct}
          </DialogContentText>
        </DialogContent>
        <DialogActions>

          <Button onClick={handleClose} color="primary" autoFocus>
            OK
          </Button>
        </DialogActions>
      </Dialog>
    </div>
  );
}
